       DBA_OBJECTS.OBJECT_TYPE,
       DBA_OBJECTS.CREATED,
       DBA_OBJECTS.LAST_DDL_TIME,
       DBA_OBJECTS.TIMESTAMP,
       DBA_OBJECTS.STATUS,
       DBA_OBJECTS.TEMPORARY,
       DBA_OBJECTS.GENERATED,
       DBA_OBJECTS.SECONDARY
  FROM CHRISTIAN_RUIZ.DBMS_STATUS, "PUBLIC".DBA_OBJECTS
 WHERE     DBA_OBJECTS.OBJECT_TYPE = DBMS_STATUS.OBJECT_TYPE
       AND DBA_OBJECTS.STATUS <> DBMS_STATUS.STATUS
       AND DBMS_STATUS.OWNER = DBA_OBJECTS.OWNER
       AND DBMS_STATUS.OBJECT_NAME = DBA_OBJECTS.OBJECT_NAME;